package org.walkframework.activiti.system.process;import java.io.Serializable;  /** * 流程流转日志 * * @author shf675 */public class ProcessLog implements Serializable{	private static final long serialVersionUID = 1L;		/**		 * 流程实例ID		 */		private String procInstId;		/**		 * 处理人员		 */		private String dealStaffId;	/**		 * 处理信息		 */		private String dealInfo;		/**		 * 回退标识。0正常 1：回退		 */		private String backTag;		/**		 * 备注		 */		private String remark;		public String getProcInstId() {		return procInstId;	}	public void setProcInstId(String procInstId) {		this.procInstId = procInstId;	}	public String getDealStaffId() {		return dealStaffId;	}	public void setDealStaffId(String dealStaffId) {		this.dealStaffId = dealStaffId;	}	public String getDealInfo() {		return dealInfo;	}	public void setDealInfo(String dealInfo) {		this.dealInfo = dealInfo;	}		public String getBackTag() {		return backTag;	}	public void setBackTag(String backTag) {		this.backTag = backTag;	}	public String getRemark() {		return remark;	}	public void setRemark(String remark) {		this.remark = remark;	}	}